<h3>Sorting Algorithms</h3>
<!--Button to run the script onclick-->
 <button onclick="runSorts()">Run</button> 
 <!-- Create Canvas to run each sort - Bubble,Insertion,Selection,Quick and Merge sort-->
 <div style="float: left; width: 350px;  font-weight: bold;">
 	Bubble Sort: <label id="bubbleSortLabel"></label>
 	<br/>
 <canvas id="mychart1" width="300" height="300"></canvas></div>

 
 <div style="float: left; width: 350px; font-weight: bold;">
 	Insertion Sort: <label id="insertionSortLabel"></label><br/>
 <canvas id="mychart2" width="300" height="300"></canvas></div>

 <div style="float: left; width: 350px; font-weight: bold;">
 	Selection Sort: <label id="selectionSortLabel"></label><br/>
 <canvas id="mychart3" width="300" height="300">
 </canvas></div>
 
 <div style="float: left; width: 450px;font-weight: bold;">
 	Merge Sort: <label id="mergeSortLabel"></label><br/>
 <canvas id="mychart4" width="300" height="300"></canvas> </div>

 <div style="float: left; width: 450px;font-weight: bold;">
 	Quick Sort: <label id="quickSortLabel"></label><br/>
 <canvas id="mychart5" width="300" height="300"></canvas> </div>

<!--Chart library used http://www.chartjs.org/ -->
 <script src="chart.js-master\chart.js"></script>

<script>
	var width = 300;
	var height = 300;
	var ctx1 = document.getElementById("mychart1").getContext("2d");	
	var ctx2 = document.getElementById("mychart2").getContext("2d");	
	var ctx3 = document.getElementById("mychart3").getContext("2d");	
	var ctx4 = document.getElementById("mychart4").getContext("2d");	
	var ctx5 = document.getElementById("mychart5").getContext("2d");	
//SwapCount for each sort measured in C program
	var bubbleSortSwapCount = 40;
	var insertionSortSwapCount = 40;
	var selectionSortSwapCount = 14;
	var mergeSortSwapCount = 40;
	var quickSortSwapCount = 14;



	var timeouts = [];
	//Function to loop and create bar chart with the given input data in array.
	function myloop(ctx, d, i, mybarchart, labelId, swapCount) {
		if (i != 0)
		{
			mybarchart.destroy();
		}
		var color = "#0000ff";
		if (i == d.length-1) {
			color = "#00ff00";
		}
		var array=d[i];
		var j=0;
		var emptyLabels = [];
		for (j=0; j<array.length; j++)
		{
			emptyLabels.push("");
		};
		var data = {
			labels: emptyLabels,
	    datasets: [
	        {	
	            label: "dataset",
	            fillColor: color,
	            strokeColor: color,
	            data: array
	        }
	    	]
		};
		var chartoptions = {
			animation: false,
			responsive: false,
		};

		mybarchart = new Chart(ctx).Bar(data, chartoptions);
		if (i < d.length-1) {
			timeouts.push(setTimeout(function(){
				myloop(ctx,d, i+1, mybarchart, labelId, swapCount);
			}
			,375));
		} else {
				var l1 = document.getElementById(labelId);
				l1.innerHTML = ": SwapCount = " + swapCount;
				
		}
	};
	//Function call to run all sorts
	function runSorts() {
		// clear existing canvas
		ctx1.clearRect(0,0, width, height);
		ctx2.clearRect(0,0, width, height);
		ctx3.clearRect(0,0, width, height);
		ctx4.clearRect(0,0, width, height);
		ctx5.clearRect(0,0, width, height);
		for (var i = 0; i < timeouts.length; i++) {
    		clearTimeout(timeouts[i]);
		}
		timeouts = [];
		document.getElementById("bubbleSortLabel").innerHTML = "";
		document.getElementById("insertionSortLabel").innerHTML = "";
		document.getElementById("selectionSortLabel").innerHTML = "";
		document.getElementById("mergeSortLabel").innerHTML = "";
		document.getElementById("quickSortLabel").innerHTML = "";


		myloop(ctx1,d1, 0, null, "bubbleSortLabel", bubbleSortSwapCount);
		myloop(ctx2,d2, 0, null, "insertionSortLabel", insertionSortSwapCount);
		myloop(ctx3,d3, 0, null, "selectionSortLabel", selectionSortSwapCount);
		myloop(ctx4,d4, 0, null, "mergeSortLabel", mergeSortSwapCount);
		myloop(ctx5,d5, 0, null, "quickSortLabel", quickSortSwapCount);
	};
